create sequence dbo.seq_campaign_product_service
    start with 1898;

alter sequence dbo.seq_campaign_product_service owner to gesco;



create table dbo.campaign_product_service
(
    id                   bigint default nextval('dbo.seq_campaign_product_service'::regclass) not null
        constraint campaign_product_service_pk
            primary key,
    campaign_id          integer
        constraint campaign_product_service_campaign_id_fk
            references dbo.campaign,
    code_product_service varchar(20),
    bk_cpnops            varchar(100),
    code                 varchar(20),
    product_service_id   bigint
        constraint campaign_product_service_product_service_id_fk
            references dbo.product_service,
    created_at           timestamp,
    updated_at           timestamp,
    created_by           bigint,
    updated_by           bigint,
    id_state             integer
);

alter table dbo.campaign_product_service
    owner to gesco;







